import { useState } from "react";
import axios from "axios";

function SolicitudAutonomos() {
  const [formData, setFormData] = useState({
    nombre: "",
    dni: "",
    direccionNegocio: "",
    direccionParticular: "",
    telefono: "",
    email: "",
    estadoCivil: "",
    regimenMatrimonial: "",
    importe: "",
    plazo: "",
    actividad: "",
    cnae: "",
  });

  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // üìå Payload m√≠nimo con mapeo a nombres de backend
      const payload = {
        TITULAR: formData.nombre,
        NOMBRE: formData.nombre.split(" ")[0] || formData.nombre, // primer nombre
        APELLIDOS: formData.nombre.split(" ").slice(1).join(" ") || "", // resto
        CIT: formData.dni,
        ACTIVIDAD: formData.actividad,
        COD_CNAE: formData.cnae,
        REGIMEN_ECONOMICO: formData.regimenMatrimonial,
        // valores b√°sicos para que no falle
        COD_DELEGACION: "001",
        TIPO_IDENTIDAD: "AUTONOMO",
        F_ALTA: new Date().toISOString().split("T")[0], // fecha actual
        F_CONSTITUCION: new Date().toISOString().split("T")[0],
      };

      const res = await axios.post("http://127.0.0.1:5000/api/identidades", payload);

      setMessage("‚úÖ Solicitud enviada con √©xito. REF_ID: " + res.data.REF_ID);
    } catch (err) {
      console.error(err);
      setMessage("‚ùå Error al enviar la solicitud: " + (err.response?.data?.error || err.message));
    }
  };

  return (
    <div style={{ maxWidth: "800px", margin: "0 auto" }}>
      <h2>Solicitud de Aval Aut√≥nomos</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Nombre y Apellidos:
          <input
            type="text"
            name="nombre"
            value={formData.nombre}
            onChange={handleChange}
            required
          />
        </label>
        <br />

        <label>
          DNI/NIE:
          <input
            type="text"
            name="dni"
            value={formData.dni}
            onChange={handleChange}
            required
          />
        </label>
        <br />

        <label>
          Direcci√≥n (Negocio):
          <input
            type="text"
            name="direccionNegocio"
            value={formData.direccionNegocio}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Direcci√≥n (Particular):
          <input
            type="text"
            name="direccionParticular"
            value={formData.direccionParticular}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Tel√©fono:
          <input
            type="text"
            name="telefono"
            value={formData.telefono}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Email:
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Estado Civil:
          <input
            type="text"
            name="estadoCivil"
            value={formData.estadoCivil}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          R√©gimen Matrimonial:
          <input
            type="text"
            name="regimenMatrimonial"
            value={formData.regimenMatrimonial}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Importe (‚Ç¨):
          <input
            type="number"
            name="importe"
            value={formData.importe}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Plazo (meses):
          <input
            type="number"
            name="plazo"
            value={formData.plazo}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Actividad:
          <input
            type="text"
            name="actividad"
            value={formData.actividad}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          CNAE:
          <input
            type="text"
            name="cnae"
            value={formData.cnae}
            onChange={handleChange}
          />
        </label>
        <br />

        <button type="submit">Enviar Solicitud</button>
      </form>

      {message && <p>{message}</p>}
    </div>
  );
}

export default SolicitudAutonomos;
